import React from 'react';
import {useState, useEffect} from 'react'

function Main(props) {
    const [birds, setBirds] = useState();

		useEffect(() => {
			let url = 'https://audubon-api.herokuapp.com/api/birds';
			fetch(url)
				.then((res) => res.json())
				.then((json) => {
					setBirds(json);
				})
				.catch(console.error);
		}, []);
    return (
        <div>
            <h1>Main Page</h1>
        </div>
    );
}

export default Main;
